import React from "react";
import styled from "styled-components";

const FooterBox = styled.div`
  height: 40px;
  width: 100%;
  background-color: #ededed;
  color: #515356;
`;

const Create = styled.h1`
  color: #515356;
`;

function Footer() {
  return <FooterBox>

    <Create></Create>
  </FooterBox>;
}

export default Footer;
